In this social media age, you can research your potential pro by perusing their work on their social media pages, googling them to read reviews from other patients, etc. You want someone who specializes in the procedure you’re considering and who can show good examples of work they’ve done.

You may need to ask for a referral to a plastic surgeon for procedures that require more work.

